import './App.css';
import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom'

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' ekement={<Login />}></Route>
        <Route path='/' ekement={<Signup />}></Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
